    render() {
        return(
            <div className="Hero">

                <p><strong>Name:Pranav Sharad Yeolo</strong></p>
                <p>Email: paranv@google.com</p>
                <p>Phone: 8546465544</p>
                <p>Address: ABC, xyz street.</p>
            </div>
        );
    }
}

export default Hero;
